script: |
  super -f text -I q11495.spq | sort > q11495.out

inputs:
  - name: q11495.spq
    data: |
      SELECT DISTINCT + cor1.col1 / cor1.col1 + + cor0.col1 AS col0 FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1

outputs:
  - name: q11495.out
    data: |
      87
      92
      98
